import './App.css';
import Login from './components/Login';
import Navbar from './components/Navbar';
import Signup from './components/Signup';

function App() {
  return (
    <>
      <Router>
        <div className="App">
        <Navbar/>
        <header className="App-header">
        <Switch>
          <Route exact path="/login">
            <Login/>
          </Route>
          <Route exact path="/signup">
            <Signup/>
          </Route>
        </Switch>
        </header>
        </div>
      </Router>
    </>

  );
}

export default App;
